import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './App.css';
import ItemCard from './components/ItemCard';
import { SimpleGrid } from '@chakra-ui/react';


const App = () => {
  const [lastOrdered, setLastOrdered] = useState(new Date().toLocaleDateString());
  const [showPopup, setShowPopup] = useState(false);
  const [selectedItem, setSelectedItem] = useState(null);

  const promptForWebhookURL = () => {
    let webhookURL = localStorage.getItem('webhookURL');

    if (!webhookURL) {
      webhookURL = prompt('Please enter your Discord webhook URL:');
      localStorage.setItem('webhookURL', webhookURL);
    }

    return webhookURL;
  };

  const clearWebhookURL = () => {
    localStorage.removeItem('webhookURL');
    window.location.reload();
  };

  const webhookURL = promptForWebhookURL();

  const [items, setItems] = useState([
    { id: 1, title: 'Almond Butter', image: 'https://lh3.googleusercontent.com/u/0/drive-viewer/AAOQEOTtwGO1JKF_nClGnqBUwxDjHveKqzSuNiwSu30kG1crDg-r_LFrVUdZ5OLVOo5El0odAd0MVOa44kqE-T8dUfGzGVpHOQ=w1397-h1054' },
    { id: 2, title: 'Blueberries', image: 'data:image/jpeg;base64,' },
    { id: 3, title: 'Broccoli', image: 'data:image/jpeg;base64,' },
    { id: 4, title: 'Bananas', image: 'data:image/jpeg;base64,' },
    { id: 5, title: 'Eggs', image: 'data:image/jpeg;base64,' },
    { id: 6, title: 'Sweet Potatoes', image: 'data:image/jpeg;base64,' },
    { id: 7, title: 'Avocado', image: 'data:image/jpeg;base64,' },
    { id: 8, title: 'Spinach', image: 'data:image/jpeg;base64,' },
    { id: 9, title: 'Carrots', image: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTSdOyv3oPoNfcoZYiXYAkTy8hmzJ5aZKfGAiPxcpY5PvQMZr7tGLFklHzpj9wFcau7tYo&usqp=CAU' },
    { id: 10, title: 'Tofu', image: 'data:image/jpeg;base64,' },
    { id: 11, title: 'Potato', image: 'data:image/jpeg;base64,' },
    { id: 12, title: 'Apples', image: 'data:image/jpeg;base64,' },
    { id: 13, title: 'Zucchini', image: 'data:image/jpeg;base64,' },
    { id: 14, title: 'Oatly', image: 'data:image/jpeg;base64,' },
    { id: 15, title: 'Dark Chocolate', image: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQdsuZIgyMSCFKH7aVvXEMkdfzIf_YTfeikXQugidbunlQcKnIV5TgC4begSMLX3cFfA-o&usqp=CAU' },
    { id: 16, title: 'Butter', image: 'data:image/jpeg;base64,' },
    { id: 17, title: 'Granola', image: 'data:image/jpeg;base64,' },
    { id: 18, title: 'Protein Powder', image: 'data:image/jpeg;base64,' },
    { id: 19, title: 'Walnuts', image: 'data:image/jpeg;base64,' },
    { id: 20, title: 'Mushrooms', image: 'https://media.istockphoto.com/id/602334322/photo/white-mushrooms-isolated-on-white-background.jpg?s=612x612&w=0&k=20&c=AMZcawgPK1_4n-ZUjiRDziiAYPu0nMwOhiHC-YNOYLo=' },
    { id: 21, title: 'Olive Oil', image: 'https://thumbs.dreamstime.com/b/extra-olive-oil-bottle-green-olives-white-background-leaves-isolated-46485602.jpg' },
    { id: 22, title: 'Jalapeños', image: 'https://media.istockphoto.com/id/183423186/photo/jalapeno-peppers.jpg?s=612x612&w=0&k=20&c=wQFau1U8ffFG4q_RI4KFDZyYGah0hWZXeiXpju1k89I=' },
    { id: 23, title: 'Asparagus', image: 'https://img.freepik.com/premium-photo/fresh-green-asparagus-white-background_146936-860.jpg?w=2000' },
    { id: 24, title: 'Milk', image: 'https://scontent-sjc3-1.xx.fbcdn.net/v/t1.6435-9/71821176_2618842194804664_3374843949528121344_n.png?_nc_cat=108&ccb=1-7&_nc_sid=09cbfe&_nc_ohc=geJtLq-USuQAX_jPtej&_nc_ht=scontent-sjc3-1.xx&oh=00_AfA2DOrYqscs1p3tS24cL3gzLN1RPnisg55amTTQR0v-rA&oe=64066E2F' }
  ]);
  const [searchTerm, setSearchTerm] = useState('');
  // const [lastOrdered, setLastOrdered] = useState('');

  const handleOrder = item => {
    setSelectedItem(item);
    setShowPopup(true);
  };

  // const handleSearch = (e) => {
  //   setSearchTerm(e.target.value);
  // };

  const filteredItems = items.filter((item) =>
    item.title.toLowerCase().includes(searchTerm.toLowerCase())
  );


  const handleConfirm = async () => {
    const discordUrl = webhookURL
    try {
      await axios.post(discordUrl, { content: `${selectedItem.title}` });
      setLastOrdered(new Date().toLocaleDateString());
    } catch (error) {
      console.error(error);
    }
    console.log(selectedItem.title);
    setShowPopup(false);
  };

  const handleCancel = () => {
    setShowPopup(false);
  };

  const handleSubmit = event => {
    event.preventDefault();
    const newItem = {
      id: Date.now(),
      title: searchTerm,
      lastOrdered: new Date().toLocaleString()
    };
    setItems([...items, newItem]);
    localStorage.setItem('items', JSON.stringify(items));
    setSearchTerm('');
  };

  return (
    <>
      <div>


      <form onSubmit={handleSubmit}>
          <input type="text" value={searchTerm} onChange={e => setSearchTerm(e.target.value)} placeholder="Search for an item" />
          <button type="submit">Create New Item</button>
        </form>
      <SimpleGrid minChildWidth='200px' maxChildWidth='300px' spacing='40px'>
      {filteredItems.length ? (
          filteredItems.map(item => (
              <ItemCard item={item}  onClick={() => handleOrder(item)}/>
          // <div key={item.id} className="card" onClick={() => handleOrder(item)}>
          //   <img src={`${item.image}`} alt={item.title} />
          //   {/* <img src={require(`${item.image}`)} alt={item.title} /> */}
          //   <h2>{item.title}</h2>
          //   <p>Last Ordered: {lastOrdered}</p>
          // </div>
       ))
        ) : (
          <p>No items found. Would you like to add a new item?</p>
        )}
      </SimpleGrid>
      {showPopup && (
        <div className="popup">
          <p>Are you sure you want to order {selectedItem.title}?</p>
          <button onClick={handleConfirm}>Yes</button>
          <button onClick={handleCancel}>No</button>
        </div>
      )}
      <button className='clearWebhook' onClick={clearWebhookURL}>Clear Webhook URL</button>
      </div>
    </>
  );  ;
};

export default App;
